import React from "react";
import "./App.css";

import Main from "./components/main";

const API_KEY = "5a2ee489ab444c36a71fb2616b400afb";

// let cityName = "Minsk";

class App extends React.Component {
  constructor() {
    super();
    this.state = {
      error: null,
      isLoaded: false
    };
    // this.getWeather();
  }

  // getWeather = async () => {
  //   const api_call = await fetch(
