  //   );
  //   const response = await api_call.json();
  //   console.log(response);
  // };

  componentDidMount() {
    fetch(
      "api.openweathermap.org/data/2.5/weather?q=London&appid=5a2ee489ab444c36a71fb2616b400afb"
    )
      .then(function(response) {
        return response.json();
      })
      .then(function(json) {
        console.log(json);
      });
  }

  render() {
    return (
      <div className="App">
        <Main />
      </div>
    );
  }
}

export default App;
